%pyspark

def create_activation(name: str):
    if name == 'leaky_relu':
        return LeakyReLU()
    else:
        return Activation(name)

def create_model(layers, nodes, actv):
    model = Sequential()

    model.add(Dense(nodes, kernel_initializer='random_uniform', input_dim=3))
    model.add(create_activation(actv))

    for i in range(2, layers):
        model.add(Dense(nodes, kernel_initializer='random_uniform'))
        model.add(create_activation(actv))

    model.add(Dense(1))
    model.compile(optimizer='adam', loss='mape', metrics=['mse'])

    return model

model = KerasRegressor(build_fn=create_model,
                       epochs=30, batch_size=256)

# 'nodes': [128, 256, 384, 512],

param_grid = {'layers': [2, 3, 4, 5, 6],
              'nodes': [128,  256, 384, 512],
              'actv': ['relu', 'elu', 'selu', 'leaky_relu']
}

fit_params = dict(callbacks=[EarlyStopping(patience=3)])

grid = GridSearchCV(estimator=model, param_grid=param_grid)
grid_result = grid.fit(x_train, y_train, **fit_params)
